export const loginRequest = async (user) => {
  return fetch("https://reqres.in/api/login/", {
    method: "POST",
    header: {
      'Content-Type': 'application/json',
      'Accept': 'application/json'
    },
    body: JSON.stringify(user)
  }).then(res => {
    console.log("res: ", res)
  })
    .error(error => {
      console.log("error: ", error)

    })
}


